import React from 'react';

const VideoCard = ({ info }) => {
  const { snippet, statistics } = info;
  const { channelTitle, title, thumbnails } = snippet;

  return (
    <div className="p-4  flex-row m-4 w-72 bg-white border border-gray-300 rounded-lg shadow-lg">
      <img className="rounded-lg" alt="Thumbnail" src={thumbnails.high.url} />
      <div className="mt-3">
        <h2 className="text-lg font-semibold">{title}</h2>
        <p className="text-gray-600">{channelTitle}</p>
        <p className="text-gray-500">{statistics.viewCount} views</p>
      </div>
    </div>
  );
};

export default VideoCard;
